import React from 'react';
import { connect } from 'redux-bundler-react';
import AoiListItem from './aoi-list-item'

class AoiList extends React.Component{
    render(){
        const {drawDataStats} = this.props;
        if(!drawDataStats) return null;
        const leaders = Object.keys(drawDataStats).map((key, i)=>{
            return {
                userName: key,
                count: drawDataStats[key].length
            }
        })
        const sortedLeaders = leaders.sort((a, b) =>{
            if( a.count  > b.count) return -1;
            if( a.count  < b.count) return 1;
            return 0;
        });
        return (
            
            <ul className="list-group">
                {
                    sortedLeaders.map((leader, i) =>{
                        return(
                            <AoiListItem
                                key={i}
                                userName = {leader.userName}
                                count = {leader.count}
                            />
                        )
                    })
                }
            </ul>
        )
    }
}

export default connect(
    'selectDrawDataStats',
    AoiList
)
